    catchupLine(writer, state[0], endLine);
    state[0] = endLine;
    state[1] = 0;
  } else {
    writer.write(comma);
  }
  state[1] = encodeInteger(writer, endColumn, state[1]);

  return index;
}

function catchupLine(writer: StringWriter, lastLine: number, line: number) {
